import { Route } from 'react-router-dom';
import { Layout } from "antd";

export default function LayoutAdmin() {
    return ( <
        Layout >
        <
        h2 > Menu Sider < /h2> <
        div > Contenido < /div> <
        h5 > Footer < /h5> <
        /Layout>
    );
}
